import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Nav from './components/Nav'
import Home from './components/Home'

function App() {
  return (
    <div className="App">
    <Router>
      <Nav />
      <Switch>
        <Route exact path='/'>
          <Home />
        </Route>
        <Route>

        </Route>
        <Route>

        </Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
